import React from 'react';
import classes from '../Navbar/Navbar.module.css';

const Navbar = () => {
    return (
        <div>
            <header>
                <nav>
                    <div>
                        <img 
                        src="https://pokedex-react-mui.netlify.app/static/media/pokedex.2800773d.png"
                        ></img>
                    </div>
                </nav>
            </header>
        </div>
    )
}

export default Navbar;
